export class Alert {
  constructor(mensagem, alertType) {
    this.mensagem = mensagem;
    this.alertType = alertType;
  }
  /**
   * Getter mensagem
   * @return {string}
   */


  getMensagem() {
    return this.mensagem;
  }
  /**
   * Getter alertType
   * @return {AlertType}
   */


  getAlertType() {
    return this.alertType;
  }
  /**
   * Setter mensagem
   * @param {string} value
   */


  setMensagem(value) {
    this.mensagem = value;
  }
  /**
   * Setter alertType
   * @param {AlertType} value
   */


  setAlertType(value) {
    this.alertType = value;
  }

}
